import React, {useState, useEffect, Fragment} from 'react';
import axios from 'axios';
import {useParams} from 'react-router-dom';

function Home() {
    const url = 'https://iot.fvh.fi/opendata/uiras/uiras2_v1.json'
    const [beaches, setBeaches] = useState([])

    useEffect(() => {
        axios.get(url)
            .then(response => {
                setBeaches(response.data.sensors)
        })
            .catch((err) => {
                console.log(err)
            })
    }, [])

    if(beaches) {
        return (
            Object.keys(beaches).map((item, index) => {
                return (
                    <h1 value = {beaches[item].code} key = {index}> {beaches[item].meta.name} and temp water is {beaches[item].data[0].temp_water} </h1>
                )
            })
        )
    }

    return (
        <div>

        </div>
    )
}

export default Home
